import React from 'react';

const Projects = () => {
  const projects = [
    {
      icon: "üéµ",
      title: "Emotion Responsive Music Player",
      description: "AI-powered music recommendation system using EEG signals, CNN, and RNN for real-time emotion detection and personalized music suggestions.",
      tech: ["Python", "CNN/RNN", "EEG Analysis"]
    },
    {
      icon: "üó≥Ô∏è",
      title: "Civix Digital Democracy Platform",
      description: "Full-stack civic engagement platform with secure authentication, petition management, and CRUD operations using modern web technologies.",
      tech: ["React", "Node.js", "MongoDB"]
    },
    {
      icon: "üçΩÔ∏è",
      title: "Restaurant Intelligence System",
      description: "ML-powered system for restaurant rating prediction and cuisine classification with advanced data preprocessing and model evaluation.",
      tech: ["Python", "Scikit-learn", "Data Science"]
    },
    {
      icon: "üè†",
      title: "PG Life Web Application",
      description: "Built a responsive full-stack website using HTML, CSS, Bootstrap for PG accommodations. Implemented user authentication and enhanced UI/UX.",
      tech: ["HTML/CSS", "Bootstrap", "JavaScript"]
    },
    {
      icon: "üöå",
      title: "Bus Booking Management System",
      description: "Developed an interactive web application with booking and seat-selection features. Optimized user experience through input validation and responsive design.",
      tech: ["HTML/CSS", "JavaScript", "PHP"]
    }
  ];

  return (
    <section id="projects" className="projects">
      <div className="container">
        <h2 className="section-title">Projects</h2>
        <div className="projects-grid">
          {projects.map((project, index) => (
            <div key={index} className="project-card">
              <div className="project-content">
                <h3>{project.icon} {project.title}</h3>
                <p>{project.description}</p>
                <div className="project-tech">
                  {project.tech.map((tech, techIndex) => (
                    <span key={techIndex} className="tech-tag">{tech}</span>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
